    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 BETWEEN col0 * - + col1 * col0 + - 0 AND - col2 + col2 / - + col1;
  - name: tab1

outputs:
  - name: q2129.out
    data: |
      85	5	59
      91	47	68
